// Sample data for the configuration profile
const profileData = {
    displayName: "Cookie Clicker",
    payloadIdentifier: "com.cookieclicker.pwa",
    url: "https://orteil.dashnet.org/cookieclicker/", // Your website URL
    icon: "https://orteil.dashnet.org/cookieclicker/img/perfectCookie.png", // Custom icon for the web clip
    organization: "Orteil, iOS-Appified by KingNullboy",
    profileIdentifier: "com.cookieclicker.config",
};

// Function to create and download the mobileconfig file
function generateProfile() {
    const mobileConfig = `<?xml version="1.0" encoding="UTF-8"?>
    <!DOCTYPE plist PUBLIC "-//Apple//DTD PLIST 1.0//EN" "http://www.apple.com/DTDs/PropertyList-1.0.dtd">
    <plist version="1.0">
        <dict>
            <key>PayloadContent</key>
            <array>
                <dict>
                    <key>FullScreen</key>
                    <true/>
                    <key>IsRemovable</key>
                    <true/>
                    <key>Label</key>
                    <string>Cookie Clicker</string>
                    <key>PayloadIdentifier</key>
                    <string>com.cookieclicker.webclip</string>
                    <key>PayloadType</key>
                    <string>com.apple.webClip.managed</string>
                    <key>PayloadUUID</key>
                    <string>` + generateUUID() + `</string>
                    <key>PayloadVersion</key>
                    <integer>1</integer>
                    <key>Precomposed</key>
                    <true/>
                    <key>URL</key>
                    <string>https://orteil.dashnet.org/cookieclicker/</string>
                    <key>Icon</key>
                    <data></data>
                </dict>
            </array>
            <key>PayloadDisplayName</key>
            <string>Cookie Clicker Web App</string>
            <key>PayloadIdentifier</key>
            <string>com.cookieclicker.profile</string>
            <key>PayloadOrganization</key>
            <string>Orteil, iOS-Appified by KingNullboy</string>
            <key>PayloadUUID</key>
            <string>` + generateUUID() + `</string>
            <key>PayloadVersion</key>
            <integer>1</integer>
            <key>PayloadType</key>
            <string>Configuration</string>
        </dict>
    </plist>`;

    const blob = new Blob([mobileConfig], { type: "application/x-apple-aspen-config" });

    const link = document.createElement("a");
    link.href = URL.createObjectURL(blob);
    link.download = "cookieclicker.mobileconfig";

    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
}

// Helper function to generate a UUID (needed for the Profile)
function generateUUID() {
    return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function(c) {
        const r = Math.random() * 16 | 0,
              v = c === 'x' ? r : (r & 0x3 | 0x8);
        return v.toString(16);
    });
}